	on an 11-cm x 12-cm plant mounted on a 17-cm stick;
	flowers burnt orange, each subtended by a filamentous bract;
	lip bilobed, darker burnt orange;
	anther cap white;





	substance indiscernable; texture matte.  Submitted to SITF for identification.
